import React from 'react';
import { Grid, Typography } from '@mui/material';
import DashboardStyles from '../DashboardStyles';
import ChevronRightOutlinedIcon from '@mui/icons-material/ChevronRightOutlined';

const Settings = () => {
  const styles = DashboardStyles();
  return (
    <Grid container direction="column" alignItems="center">
      <Grid item className={styles.typoTitle} style={{ marginBottom: '1rem' }}>
        <Typography variant="h5">My Wallet</Typography>
      </Grid>
      {/* 1 */}
      <Grid item className={styles.accordionContainer} style={{marginBottom:'1rem'}}>
        <Grid container>
          <Grid item xs={11}>
            Change Password
          </Grid>
          <Grid item xs={1}>
            <ChevronRightOutlinedIcon />
          </Grid>
        </Grid>
      </Grid>
      {/* 2 */}
      <Grid item className={styles.accordionContainer} style={{marginBottom:'1rem'}}>
        <Grid container>
          <Grid item xs={11}>
            Auto-Lock Timer
          </Grid>
          <Grid item xs={1}>
            <ChevronRightOutlinedIcon />
          </Grid>
        </Grid>
      </Grid>
      {/* 3 */}
      <Grid item className={styles.accordionContainer}>
        <Grid container>
          <Grid item xs={11}>
            Change Network
          </Grid>
          <Grid item xs={1}>
            <ChevronRightOutlinedIcon />
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default Settings;
